function I = fcnK1J(S, T, u, alpha, F, tol)
t2 = F .^ 2;t5 = F .* T;t7 = sqrt(t2 + t5 + u);t8 = 0.1e1 ./ t7;t11 = u .^ 2;t12 = 0.1e1 ./ t11;t13 = t12 .* T;t14 = 0.1e1 ./ F;t18 = T .^ 2;t19 = t11 .* u;t20 = 0.1e1 ./ t19;t29 = t8 ./ (-t18 + 0.4e1 .* u);t30 = F .* t29;t33 = t18 .^ 2;t37 = sqrt(u);t46 = log(t14 .* (0.2e1 .* t7 .* t37 + t5 + 0.2e1 .* u));t60 = -t8 ./ t2 ./ u ./ 0.2e1 + 0.5e1 ./ 0.4e1 .* t8 .* t14 .* t13 + 0.15e2 ./ 0.8e1 .* t8 .* t20 .* t18 - 0.15e2 ./ 0.4e1 .* t30 .* t20 .* t18 .* T - 0.15e2 ./ 0.8e1 .* t29 .* t20 .* t33 - 0.15e2 ./ 0.8e1 .* t46 ./ t37 ./ t19 .* t18 + 0.13e2 .* t30 .* t13 + 0.13e2 ./ 0.2e1 .* t29 .* t12 .* t18 - 0.3e1 ./ 0.2e1 .* t8 .* t12 + 0.3e1 ./ 0.2e1 .* t46 ./ t37 ./ t11;
I = t60(:,:,2) - t60(:,:,1);

end
